script: |
  super -f text -I q11622.spq | sort > q11622.out

inputs:
  - name: q11622.spq
    data: |
      SELECT DISTINCT - - col2, col0 / - col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * col1 * - + 21 * - 99 NOT BETWEEN + 39 AND - col2;
  - name: tab1

outputs:
  - name: q11622.out
    data: |
      59	-1
      68	-1
      96	-1
